    false,nt"url": null,nt"notes": "This annual narrative report for Pea Island
    National Wildlife Refuge summarizes Refuge activities during the 1979 calendar year.
     The report begins with an introduction to the Refuge and a summary of the yearu2019s
    climatic and habitat conditions.  Land acquisition is also covered in this section,
    as is the system status.  A construction and maintenance section is provided next.
     Habitat management is also covered- croplands and wetlands are discussed.  The
    wildlife section of the report discusses endangered species, threatened species,
    migratory birds, mammals, and non-migratory birds.  Interpretation and recreation
    are also described; topics include recreation and enforcement.  Field investigations,
    cooperative programs, items of interest, and safety information are provided at
